import React from "react";
import "./Menu.css"; // Importez votre fichier CSS

const Menu = () => {
  // Fonction pour gérer la navigation vers la page des participants
  const navigateToParticipants = () => {
    window.location.href = "/participants"; // Redirige vers la page des participants
  };

  return (
    <div className="menu">
      <ul>
        <li>
          <a href="#">Secrets</a>
        </li>
        <li>
          <a href="#">Classement</a>
        </li>
        <li>
          <a href="#" onClick={navigateToParticipants}>
            Participants
          </a>
        </li>
      </ul>
    </div>
  );
};

export default Menu;
